import React from 'react';
import ReactDOM from 'react-dom';
import './main.css';

import App from './App';
import {MenuContainer, MenuBrick} from './Components.js';

var menuList = {name: "Strona Główna",
                  name: "Dotychczasowe Imprezy",
                  name: "Cennik",
                  name: "O Mnie"};

ReactDOM.render(<App />,
                <Menu menuList={menuList} />,
                document.getElementById('root'));
